events.inlineCode:
if(runtimeScene.getGame().getInputManager().isMouseButtonReleased(0)){
    let current = objects.find(item => {
        return item.getVariableBoolean(item.getVariables().get("dragged"), true);
    });
    if (current){
        objects.forEach(ele => {
            let mouseX = runtimeScene.getGame().getInputManager().getMouseX();
            let mouseY = runtimeScene.getGame().getInputManager().getMouseY();
            if(ele.getName() == "IF_item_target" && ele.getX() <= mouseX && mouseX <= ele.getX()+ele.getWidth() && ele.getY() <= mouseY && mouseY <= ele.getY()+ele.getHeight() ){
                current.setX(ele.getX());
                current.setY(ele.getY());
            }
        });
    }
}

let texts = [
    "Hast du den 1. Zug?",
    "Gehe in eine Ecke. \n\nNchster Zug: Hat der Gegner ein O in \ndie Ecke gegenber gesetzt?",
    "Gehe in die Ecke gegenber von Zug 1.\n\nNchster Zug: Ist das Feld zwischen \nden beiden Eckkreuzen noch frei?",
    "Gehe in eine andere freie Ecke. \n\nNchster Zug: Ist das Feld zwischen \nden beiden Eckkreuzen noch frei?",
    "Gehe in eine freie Ecke. \n\nNchster Zug: Hat der Gegner 2 O in \neiner Reihe?",
    "Blockiere die Reihe. \n\nNchster Zug: Hast du 2 X in einer \nReihe?",
    "Gehe in eine freie Ecke. \n\nNchster Zug: Hast du 2 X in einer \nReihe?"];

if (runtimeScene.getTimeManager().isFirstFrame()) {
  // Hide the first instance of PlayerHitBoxes.
  for (let i = 0; i<=6; i++){
        let txt = runtimeScene.createObject("IF_item_text");
        let obj = runtimeScene.createObject("IF_item");
        obj.setWidth(300);
        obj.setHeight(100);
        obj.setX(1600 - obj.getWidth() - 20);
        obj.setY(i*110 + 20);
        obj.setZOrder(2);

        txt.setWidth(280);
        txt.setHeight(80);
        txt.setX(obj.getX()+10);
        txt.setY(obj.getY()+10);
        txt.setZOrder(3);
        txt.setString(texts[i]);

        obj.setVariableString(obj.getVariables().get("Name"), "Box"+i);
        txt.setVariableString(txt.getVariables().get("Source"), "Box"+i);
  }
}


objects.forEach(item => {
    if (item.getVariableString(item.getVariables().get("Source")) != 0){
        let obj = objects.find(ele => ele.getVariableString(ele.getVariables().get("Name")) == item.getVariableString(item.getVariables().get("Source")));
        item.setX(obj.getX()+10);
        item.setY(obj.getY()+10);
    }
});

if(runtimeScene.getGame().getInputManager().isMouseButtonPressed(0)){

    let object = objects.find(item => item.getVariableBoolean(item.getVariables().get("dragged"),true));

    if(!object){
        object = objects.find(item => {
        let mouseX = runtimeScene.getGame().getInputManager().getMouseX();
        let mouseY = runtimeScene.getGame().getInputManager().getMouseY();
        if (item.getName() == "IF_item" && item.getX() <= mouseX && mouseX <= item.getX()+item.getWidth() && item.getY() <= mouseY && mouseY <= item.getY()+item.getHeight() ){
            return true;
        }
        return false;
    });
    }
    if(object){
        object.setVariableBoolean(object.getVariables().get("dragged"),true);
        //get text + box to the front
        object.setZOrder(50);
        //find text
        objects.forEach(item => {
            if (item.getVariableString(item.getVariables().get("Source")) != 0){
                if(item.getVariableString(item.getVariables().get("Source")) == object.getVariableString(object.getVariables().get("Name"))){
                    item.setZOrder(51);
                }
            }
        });
    }
} else if (runtimeScene.getGame().getInputManager().isMouseButtonReleased(0)){
    let object = objects.find(item => item.getVariableBoolean(item.getVariables().get("dragged"),true));
    if (object){
        //get text + box to the back
        object.setZOrder(2);
        //find text
        objects.forEach(item => {
            if (item.getVariableString(item.getVariables().get("Source")) != 0){
                if(item.getVariableString(item.getVariables().get("Source")) == object.getVariableString(object.getVariables().get("Name"))){
                    item.setZOrder(3);
                }
            }
        });
    }
    objects.forEach(item => {
        if (item.getName() == "IF_item"){
           item.setVariableBoolean(item.getVariables().get("dragged"),false) 
        }
    });
}
